INSERT INTO `Study` VALUES (1,'First study',8.00,11.50,'Infants\' perceptual sensitivity to human vs monkey faces.','<p><strong>${{childName}} </strong>will be sitting on your lap and watch a short clip of videos on a screen in front of ${{him/her}}. ${{he/she}} will also hear different sounds while watching the videos. These sounds include emotional voices of female adults. We will use a special camera to record ${{his/her}} looking location on the screen, which will help us understand the early development of visual cognitive capacities in preverbal infants. The study will last for about 5 minutes.</p>',0,2,'Behavioural','Include','Include','Include','Include','2020-03-21 09:38:30','2020-08-12 18:11:16'),(2,'Study_2',20.50,36.00,'Examine toddlers\' brain response to musicial melodies~ neural oscillations','<p><strong style=\"background-color: rgb(254, 254, 254);\">${{childName}}&nbsp;</strong><span style=\"background-color: rgb(254, 254, 254);\">will be sitting on your lap and watch a short clip of videos on a screen in front of ${{him/her}}. To understand the development of neural system, ${{childName}} will be wearing a recording cap while watching the videos. We will use a camera to monitor ${{his/her}} attention status, which will help us determine the quality of recorded neural signals. The study will last for about 10 minutes.</span></p>',0,2,'EEG/ERP','Include','Include','Include','Include','2020-03-21 09:38:30','2020-08-12 18:17:13'),(3,'Study_3',9.00,13.50,'','<p>I am emailing you today to let you know that we currently have a new study going on that ${{childName}} is eligible to participate in, so I have included a short summary of it below in case you are interested.</p><p>\nStudy 3</p>',0,2,'fNIRS','Include','Include','Include','Include','2020-03-21 09:38:30','2020-08-21 22:26:24'),(4,'Study_4',6.00,10.50,'Delos~','<p>I am emailing you today to let you know that we currently have a new study going on that ${{childName}} is eligible to participate in, so I have included a short summary of it below in case you are interested.</p><p>Study 4</p>',0,2,'Behavioural','Include','Include','Include','Include','2020-03-21 09:38:30','2020-08-21 22:26:33'),(5,'Study_five',7.50,12.50,'Description','<p><strong style=\"color: rgb(255, 153, 0);\"><em>I am emailing you today to let you know that we currently</em></strong> have a new study going on that ${{childName}} is eligible to participate in, so I have included a short summary of it below in case you are interested.</p>',0,2,'fNIRS','Include','Include','Include','Exclude','2020-03-21 09:38:30','2020-08-21 18:13:28'),(6,'Study_6',5.00,11.00,'and neuroimaging study focusing on preverbal infants\' visual processing of rapidly presented pictures.','<p>I am emailing you today to let you know that we currently have a new study going on that ${{childName}} is eligible to participate in, so I have included a short summary of it below in case you are interested.</p><p>Study 6</p>',0,2,'EEG/ERP','Include','Include','Include','Include','2020-03-21 09:38:30','2020-07-11 22:40:18'),(9,'Study_9',12.00,16.50,'to be updated.','<p>I am <strong>emailing</strong> you today to let you know that we currently have a new study going on that ${{childName}} is eligible to participate in, so I have included a short summary of it below in case you are interested.\n</p>',0,2,'EyeTracking','Include','Exclude','Include','Include','2020-03-21 09:38:30','2020-08-21 22:25:35'),(10,'Study_10',16.00,48.00,'This study examines how infants attend to facial features, such as eyes, mouths regions when they are watching an interactive videos. We will use a special camera to record where your baby is looking at to understand their attentional patterns.','<p>I am emailing you today to let you know that we currently have a new study going on that ${{childName}} is eligible to participate in, so I have included a short summary of it below in case you are interested.</p><p>Study 10</p>',0,2,'Behavioural','Include','Include','Include','Include','2020-03-21 09:38:30','2020-04-19 00:12:49'),(30,'Study 11',7.00,13.00,'no summary yet. it is an short behavioural study focusing on babies\' sensitivity to social status.','<p>I am emailing you today to let you know that we currently have a new study going on that ${{childName}} is eligible to participate in, so I have included a short summary of it below in case you are interested.\n\nStudy 11</p>',0,2,'Behavioural','Include','Include','Include','Include','2020-04-11 21:49:48','2020-08-21 22:25:48'),(31,'Neural Representation',14.00,28.00,'no idea~','<p>I am emailing you today to let you know that we currently have a new study going on that ${{childName}} is eligible to participate in, so I have included a short summary of it below in case you are interested.</p><p>\nStudy neural representation</p>',0,2,'EEG/ERP','Include','Include','Exclude','Include','2020-04-11 21:50:33','2020-08-21 22:26:01'),(32,'interactive studies',18.00,24.00,'observing baby and mom interactions by examining their eye movement patterns.','<p>I am emailing you today to let you know that we currently have a new study going on that ${{childName}} is eligible to participate in, so I have included a short summary of it below in case you are interested.</p><p>Eye tracking studies</p>',0,2,'EyeTracking','Include','Exclude','Include','Include','2020-04-11 21:52:08','2020-08-21 22:26:14'),(38,'Sample study for 6th Test Lab',8.00,18.00,'Study description should be a short summary of a study. So RAs can read it to parents during recruitment.','<p><strong style=\'background- color: rgb(254, 254, 254); \'>${{childName}}&nbsp;</strong><span style=\'background - color: rgb(254, 254, 254); \'>will be sitting on your lap and watch a short clip of videos on a screen in front of ${{him/her}}. To understand the development of neural system, ${{childName}} will be wearing a recording cap while watching the videos. We will use a camera to monitor ${{his/her}} attention status, which will help us determine the quality of recorded neural signals. The study will last for about 10 minutes.</span></p>',0,11,'Behavioural','Include','Include','Include','Include','2020-08-21 20:50:09','2020-08-21 20:50:09');
